caption.text:
Seringkali kita mendengar mengenai generasi Z. Namun siapakah sebenarnya yang dimaksud dengan generasi Z? Generasi Z adalah mereka yang lahir antara tahun 1995-2010. Mereka akan segera memasuki dunia kerja dalam hitungan beberapa tahun lagi. Namun apakah yang membedakan generasi Z dengan generasi lainnya?
